          />
        )}
        {!this.props.match && (
          <AppContenido
            viewKey=""
            a単adirManejadorDeClick={store.obtenerManejadorDeClick}
          />
        )}
        <ComingSoonPage />
      </div>
    );
  }
}

export default Homepage;
